def bubble_sort_tuple(list): 
    for i in range(len(list)):
        swap = False
        for j from i+1 to len(list): 
            if list[i][1] > list[j][1]: 
                list[i], list[j] = list[j], list[i]  
                swap = True
        if not swap: break
    return list
